import React from 'react';
import { Card, ListGroup, Button } from 'react-bootstrap'
const custom_style = { width: '45%', borderRadius: "10px", marginLeft: "0" };
const custCardStyle={ width: '70%',alignItems:"flex-start"};
function JobCardComponent(data) {
    return (

        <div className="JobsCardComponent">
            <Card style={{ width: '100%', borderRadius: "10px" }}>
                <div className="flexBox_column_joined">
                    <Card.Body style={{ width: '20vh' }}>
                        <Card.Img variant="top" style={custom_style} src={data.jobImageUrl} />
                        <Card.Title>{data.JobCompanyName} </Card.Title>
                    </Card.Body>
                    <ListGroup className="list-group-flush" style={custCardStyle}>
                        <Card.Title className="job_apply_Button">{data.jobDesignation} </Card.Title>
                        <ListGroup className="list-group-flush">{data.jobSalary}</ListGroup>
                        <ListGroup className="list-group-flush">{data.jobExpireDate}</ListGroup>
                        <ListGroup className="list-group-flush">{data.jobLevel}</ListGroup>
                    </ListGroup>
                </div>


            </Card>
        </div>
    )
}

export default JobCardComponent;
